css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("mobile.twitter.com") {
	/* Logged out */
	.timeline-head {
		background: #01B7EE !important;
	}
	.inputs {
		box-shadow: none !important;
		border-radius: 0 !important;
	}
	/* Logged in */
	body {
		background: none !important;
		font-family: Roboto, Arial, sans-serif !important;
	}
	.navTitle .title, .timeline-head > .title {
		font-weight: normal !important;
		font-size: 16px !important;
		margin-left: 20px !important;
	}
	body[brandbar="yes"] views {
		padding-top: 50px;
	}
	body[navbar="yes"] views {
		padding-top: 44px;
	}
	body[navbar="yes"][brandbar="yes"] views {
		padding-top: 94px;
	}
	.brandbar .navItem:not([nav="compose"]), .button.transparent.back {
		border-radius: 100% !important;
		overflow: hidden !important;
		position: relative !important;
		background-color: transparent !important;
		width: 32px !important;
		height: 32px !important;
		margin-left: 10px !important;
		padding: 2px 0 !important;
	}
	.navbar .navLabel {
		display: none !important;
	}
	.navbar .navIcon {
		margin-top: 6px !important;
	}
	.profile-link avatar, .avatar {
		border-radius: 100% !important;
		border: none !important;
		overflow: hidden !important;
	}
	#view-profile .avatar {
		box-shadow: 0px 2px 5px 0px rgba(0, 0, 0, 0.26), 0px 2px 10px 0px rgba(0, 0, 0, 0.16);
	}
	.brandbar .navItem:not([nav="compose"]) {
		margin-top: 4px !important;
	}
	.button.transparent.back {
		padding: 7px 6px !important;
		margin-right: 10px !important;
		margin-left: 0 !important;
	}
	.brandbar {
		padding-left: 0px !important;
		padding-right: 10px !important;
	}
	.brandmark, .larrybird {
		display: none !important;
	}
	.navItem {
		border-top: none !important;
	}
	.brandbar, .navbar, .quickActions, .quickActionsContainer {
		background-image: none !important;
		text-shadow: none !important;
		border: none;
	}
	.brandbar {
		height: 50px !important;
	}
	.navbar .navItem {
		max-width: none !important;
	}
	.quickActions {
		background-color: #F1F1F1 !important;
	}
	i:not(.media-indicator) {
		background-image: url(data:image/png;base64,) !important;
	}
	header {
		text-shadow: none !important;
		box-shadow: none !important;
	}
	.tweet-box-textarea:focus {
		border-color: #5BABE5 !important;
	}
	.button {
		background-image: none !important;
		border-radius: 2px !important;
		position: relative !important;
	}
	.button.red {
		background-color: #e74c3c !important;
	}
	.button.signup, .button.red {
		border: 1px solid transparent !important;
		box-shadow: none !important;
		text-shadow: none !important;
	}
	.button.signup {
		background-color: #01B7EE !important;
		color: white !important;
	}
	.search-form {margin: 5px 0 !important;}
	.search-query {
		border-radius: 0 !important;
		background-color: rgba(255,255,255,0.3) !important;
		color: white !important;
		border: none !important;
		border-radius: 2px !important;
		padding: 7px 28px 7px 29px !important;
	}
	.searchIcon {
		filter: brightness(200%);
	}
	.searchIcon, .searchdelete {
		margin-top: -1px !important;
	}
	.searchdelete > span {
		border-radius: 100% !important;
		padding: 0 !important;
		background-position: center !important;
		width: 14px !important;
		height: 14px !important;
		overflow: hidden !important;
		filter: invert(1) brightness(200%)
	}
	.dialog {
		border-radius: 2px !important;
		box-shadow: 0px 2px 5px 0px rgba(0, 0, 0, 0.26), 0px 2px 10px 0px rgba(0, 0, 0, 0.16) !important;
	}
	.dialog-cover {
		background-color: rgba(0,0,0,0.3) !important;
	}
	.stream-item-wrapper, .tweet-dogear {
		transition: all 0.3s !important;
	}
	.stream-tweet[actions="true"] > .tweet-dogear, .stream-tweet[actions="true"] > .stream-item-wrapper, .stream-item[actions="true"] > .stream-item-wrapper {
		opacity: 0 !important;
	}
	.tweet-action:active {
		background: none !important;
	}
	.stream-item, .activeLink, .stream-end, .navItem, .link-item, .tweet-action {
		position: relative !important;
	}
	.navItem[nav="compose"] {
		overflow: hidden !important;
		position: fixed !important;
		bottom: 15px !important;
		right: 15px !important;
		z-index: 999 !important;
		box-shadow: 0px 2px 5px 0px rgba(0, 0, 0, 0.26), 0px 2px 10px 0px rgba(0, 0, 0, 0.16) !important;
		border-radius: 100% !important;
		width: 56px !important;
		height: 56px !important;
		max-width: none !important;
		padding: 15px 17px !important;
		background-color: #5BABE5;
	}
	.navItem[nav="compose"]:active {
		box-shadow: 0px 8px 17px 0px rgba(0, 0, 0, 0.2), 0px 6px 20px 0px rgba(0, 0, 0, 0.19) !important;
	}
	.stream-end::after,
	.activeLink::after,
	.brandbar .navItem::after,
	.navbar .navItem::after, .navItem[nav="compose"]::after, .button::after,
	.stream-item::after, .link-item::after, .tweet-action::after {
		content:"";
		position: absolute;
		top: 0;
		left: 50%;
		background-color: rgba(204,204,204, 0.29);
		height: 100%;
		width: 0%;
		border-radius: 0.75em / 2em;
		transition: all 0.2s;
		text-align: center;
		pointer-events: none !important;
	}
	.brandbar .navItem::after,
	.navItem[nav="compose"]::after,
	.button.transparent.back::after {
		width: 0px;
		height: 0px;
		top: 50%;
		border-radius: 100% !important;
	}
	.activeLink:active::after,
	.stream-end:active::after,
	.stream-item:active::after,
	.brandbar .navItem:active::after,
	.navbar .navItem:active:not(.active)::after, .navItem[nav="compose"]:active::after,
	.link-item:active::after, .button:active::after,
	.tweet-action:active::after {
		width: 100% !important;
		left:0;
		top: 0 !important;
		height: 100% !important;
		border-radius: 0 !important;
	}
	.slideshow .tweet-actions {
		width: 100% !important;
	}
	.slideshow .tweet-action {
		width: 25% !important;
	}
}
